import * as types from "./../Constant/ActionTypes";

var initialState = [];

const products = (state = initialState, action) => {
  switch (action.typpe) {
    case types.PRODUCTS:
      console.log(action.products);
      //   state = action.products;
      return [...state];
    default:
      return [...state];
  }
};

export default products;
